bsp;&nbsp;&nbsp;&nbsp;System.out.println(p.getName()&nbsp;+&nbsp;&quot;,&nbsp;&quot;+&nbsp;p.getDescription());\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\r\n&nbsp;&nbsp;&nbsp;}</pre><p style=\";text-align: justify;font-size: 14px;font-family: DengXian;white-space: normal\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">1</span><span style=\"font-family: 宋体\">）</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">_________&nbsp;&nbsp;&nbsp; </span><span style=\"font-family: 宋体\">（</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">2</span><span style=\"font-family: 宋体\">）</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">_________&nbsp;&nbsp;&nbsp; </span><span style=\"font-family: 宋体\">（</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">3</span><span style=\"font-family: 宋体\">）</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">_________</span></p><p style=\";text-align: justify;font-size: 14px;font-family: DengXian;white-space: normal\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">4</span><span style=\"font-family: 宋体\">）</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">_________&nbsp;&nbsp;&nbsp; </span><span style=\"font-family: 宋体\">（</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">5</span><span style=\"font-family: 宋体\">）</span><span style=\"font-family: &#39;Times New Roman&#39;, serif\">_________</span></p><p><br/></p>', '--', '--', '--', '--', '', '0.65', '2a58739e2ea04f1aa69da84726836e8f', '');
